    const [list, setList] = useState([]);
    const [username, setUsername] = useState("")
    
    useEffect(() => {
      axios.post("/api/Login/user",{
        email,
      }).then((res)=>{
        console.log(res)
        setList(res.data)
        localStorage.setItem('username',username)
      })
    }, [])
  return (
    <div>Profile</div>
  )
}

